contract FatSaleNFT is ERC721AQueryable, Ownable {
    uint256 public feeMode;
    address public feeCa;

    address public creator;

    string public _url;

    bool public istheSame;

    bool public isOnlyAdmin;

    uint256 public maxSupply;

    uint256 public feePerNFT;

    address private fatsaleFeeAddr;

    string public projectIpfsKey;

    mapping(address => uint256) public _userMintCount;

    uint256 public _userMintLimit;

    uint256 fatsaleMintFeePercent = 500;
    uint256 public openInviterFee;

    bool public enableInviter;
    address public factory;

    event reward(
        address indexed inviter,
        address indexed user,
        uint256 rewardAmount
    );

    uint256[] public invitorRewardPercentList;

    function openInviter(uint256[] calldata newValue) public payable onlyOwner {
        require(newValue.length <= 7, "length > 7 !");
        require(msg.value >= openInviterFee, "not fee");
        payable(fatsaleFeeAddr).transfer(msg.value);
        enableInviter = true;
        invitorRewardPercentList = new uint256[](newValue.length);
        for (uint256 i = 0; i < newValue.length; i++) {
            invitorRewardPercentList[i] = newValue[i];
        }
    }

    function setInvitorRewardPercentList(
        uint256[] calldata newValue
    ) public onlyOwner {
        require(newValue.length <= 7, "length > 7 !");
        invitorRewardPercentList = new uint256[](newValue.length);
        for (uint256 i = 0; i < newValue.length; i++) {
            invitorRewardPercentList[i] = newValue[i];
        }
    }

    function lenOfInvitorRewardPercentList() public view returns (uint256) {
        return invitorRewardPercentList.length;
    }

    // function setFeePerNFT(uint256 newValue) public onlyOwner {
    //     feePerNFT = newValue;
    // }

    mapping(address => bool) public whitelistedUsers;

    function multiWLs(
        address[] calldata addresses,
        bool status
    ) public onlyOwner {
        for (uint256 i = 0; i < addresses.length; i++) {
            whitelistedUsers[addresses[i]] = status;
        }
    }

    constructor(
        string[] memory stringP,
        address[] memory addrP,
        uint256[] memory uintP,
        bool[] memory boolP,
        uint256[] memory factoryFeeList,
        address[] memory factoryAddrList
    ) ERC721A(stringP[0], stringP[1]) {
        _url = stringP[2];
        projectIpfsKey = stringP[3];

        istheSame = boolP[0];
        isOnlyAdmin = boolP[1];

        maxSupply = uintP[1];
        feePerNFT = uintP[2];
        _userMintLimit = uintP[3];

        feeMode = uintP[4];
        feeCa = addrP[1];
        if (feeCa != address(0)) {
            require(IERC20(feeCa).totalSupply() != 0, "totalsupply == 0");
        }

        if (uintP[0] > 0) {
            _safeMint(addrP[0], uintP[0]);

            _userMintCount[addrP[0]] += uintP[0];
            _userId[addrP[0]] = getUserCount();

            userInfo memory newUser = userInfo({
                id: _userId[addrP[0]],
                addr: addrP[0],
                mintCount: _userMintCount[addrP[0]],
                inviterAddr: address(0),
                inviterCount: 0,
                reward: 0
            });
            _users.push(newUser);
        }

        require(addrP[0] != address(0), "null address receiver!");
        creator = addrP[0];
        fatsaleMintFeePercent = factoryFeeList[0];
        openInviterFee = factoryFeeList[1];
        fatsaleFeeAddr = factoryAddrList[0];
        whitelistedUsers[addrP[0]] = true;
    }

    event add_reward_error(address indexed inviter, uint256 inviterAmount);
    event sent_reward(address indexed inviter, uint256 inviterAmount);
    event add_inviterCount_error(address indexed inviter);

    function payTo(
        address payable to,
        uint256 amount,
        uint256 mode // 0 = transfer ETH , other = transfer ERC20
    ) private {
        if (mode == 0) {
            to.transfer(amount);
        } else {
            IERC20(feeCa).transfer(to, amount);
        }
    }

    function mint(
        address _receiver,
        uint256 _mintAmount,
        string memory value
    ) public payable {
        require(msg.sender == tx.origin, "NFT : reject contract");

        if (isOnlyAdmin) {
            require(owner == msg.sender, "Ownable: caller is not the owner");
            _url = value;

            _safeMint(_receiver, _mintAmount);
            _userMintCount[_receiver] += _mintAmount;

            if (_userMintCount[_receiver] == _mintAmount) {
                _userId[_receiver] = getUserCount();
                userInfo memory newUser = userInfo({
                    id: _userId[_receiver],
                    addr: _receiver,
                    mintCount: _userMintCount[_receiver],
                    inviterAddr: address(0),
                    inviterCount: 0,
                    reward: 0
                });
                _users.push(newUser);
            } else {
                _users[_userId[_receiver]].mintCount = _userMintCount[
                    _receiver
                ];
            }

            if (msg.value > 0) {
                payable(fatsaleFeeAddr).transfer(msg.value);
                // payTo(
                //     payable(fatsaleFeeAddr),
                //     msg.value,
                //     0
                // );
            }
        } else {
            require(totalSupply() + _mintAmount <= maxSupply, "NFT : too much");
            if (
                owner != address(0) &&
                owner != address(0xdead) &&
                feePerNFT != 0
            ) {
                uint256 userValue;
                if (feeMode == 0) {
                    userValue = msg.value;
                    require(
                        userValue == feePerNFT * _mintAmount,
                        "NFT : not fee ETH"
                    );
                } else {
                    uint256 userBeforeMintBal = IERC20(feeCa).balanceOf(
                        msg.sender
                    );

                    uint256 needFee = feePerNFT * _mintAmount;
                    IERC20(feeCa).transferFrom(
                        msg.sender,
                        address(this),
                        needFee
                    );

                    uint256 userAfterMintBal = IERC20(feeCa).balanceOf(
                        msg.sender
                    );
                    require(
                        userBeforeMintBal - userAfterMintBal >= needFee,
                        "NFT : not fee erc20"
                    );

                    if (IERC20(feeCa).balanceOf(address(this)) >= needFee) {
                        userValue = needFee;
                    } else {
                        userValue = IERC20(feeCa).balanceOf(address(this));
                    }
                }

                uint256 ownerFee = (userValue *
                    (10000 - fatsaleMintFeePercent)) / 10000;

                // payable(fatsaleFeeAddr).transfer(userValue - ownerFee);
                payTo(payable(fatsaleFeeAddr), userValue - ownerFee, feeMode);

                if (enableInviter) {
                    address invitor = _receiver;

                    if (
                        _invitor[msg.sender] == address(0) &&
                        !whitelistedUsers[msg.sender] &&
                        invitor != address(0)
                    ) {
                        require(
                            _userMintCount[invitor] > 0 ||
                                whitelistedUsers[invitor],
                            "invitor buy zero || invitor not wl"
                        );
                        require(invitor != msg.sender, "inviter == msg !");
                        _invitor[msg.sender] = invitor;

                        if (
                            _userId[invitor] != 0 ||
                            getUserById(0).addr == invitor
                        ) {
                            _users[_userId[invitor]].inviterCount += 1;
                        } else {
                            emit add_inviterCount_error(invitor);
                        }
                    }

                    uint256 inviterAmount;
                    uint256 totalShare = 0;

                    for (uint256 i; i < invitorRewardPercentList.length; i++) {
                        totalShare += invitorRewardPercentList[i];
                    }

                    uint256 perInviteAmount = (userValue * totalShare) / 10000;
                    uint256 alreadyAdd = 0;
                    address current = msg.sender;
                    for (uint256 i; i < invitorRewardPercentList.length; ++i) {
                        address inviter = _invitor[current];

                        if (address(0) == inviter) {
                            // inviter = owner;
                            break;
                        }

                        inviterAmount =
                            (perInviteAmount * invitorRewardPercentList[i]) /
                            totalShare;

                        // payable(inviter).transfer(inviterAmount);
                        payTo(payable(inviter), inviterAmount, feeMode);

                        alreadyAdd += inviterAmount;

                        if (
                            _userId[inviter] != 0 ||
                            getUserById(0).addr == inviter
                        ) {
                            _reward[inviter] += inviterAmount;
                            _users[_userId[inviter]].reward = _reward[inviter];
                            emit sent_reward(inviter, inviterAmount);
                        } else {
                            emit add_reward_error(inviter, inviterAmount);
                        }

                        current = inviter;
                    }
                    if (perInviteAmount > alreadyAdd) {
                        // payable(owner).transfer(perInviteAmount - alreadyAdd);
                        payTo(
                            payable(owner),
                            perInviteAmount - alreadyAdd,
                            feeMode
                        );
                    }
                    ownerFee -= perInviteAmount;
                }
                // payable(owner).transfer(ownerFee);
                payTo(payable(owner), ownerFee, feeMode);
            }

            require(
                _userMintCount[msg.sender] <= _userMintLimit ||
                    _userMintLimit == 0,
                "NFT : limit"
            );

            _safeMint(msg.sender, _mintAmount);
            _userMintCount[msg.sender] += _mintAmount;

            if (_userMintCount[msg.sender] == _mintAmount) {
                _userId[msg.sender] = getUserCount();
                userInfo memory newUser = userInfo({
                    id: _userId[msg.sender],
                    addr: msg.sender,
                    mintCount: _userMintCount[msg.sender],
                    inviterAddr: address(_invitor[msg.sender]),
                    inviterCount: 0,
                    reward: 0
                });
                _users.push(newUser);
                _userBindIds[_invitor[msg.sender]].add(_userId[msg.sender]);
            } else {
                _users[_userId[msg.sender]].mintCount = _userMintCount[
                    msg.sender
                ];
                _users[_userId[msg.sender]].inviterAddr = _invitor[msg.sender];
            }
        }
    }

    function setURI(string memory value) public onlyOwner {
        _url = value;
    }

    function setProjectIpfs(string memory _key) public onlyOwner {
        projectIpfsKey = _key;
    }

    function _startTokenId() internal view virtual override returns (uint256) {
        return 1;
    }

    mapping(address => uint256) public _reward;

    userInfo[] public _users;

    function getUserCount() public view returns (uint256) {
        return _users.length;
    }

    struct userInfo {
        uint256 id;
        address addr;
        uint256 mintCount;
        address inviterAddr;
        uint256 inviterCount;
        uint256 reward;
    }

    function getUserById(
        uint256 _ind
    ) public view returns (userInfo memory _userinfo) {
        return _users[_ind];
    }

    function getAllUserInfo()
        public
        view
        returns (userInfo[] memory _userinfo)
    {
        uint256 userCount = getUserCount();
        _userinfo = new userInfo[](userCount);
        for (uint256 i; i < userCount; i++) {
            _userinfo[i] = _users[i];
        }
    }

    mapping(address => address) public _invitor;

    using EnumerableSet for EnumerableSet.AddressSet;
    using EnumerableSet for EnumerableSet.UintSet;

    mapping(address => EnumerableSet.UintSet) private _userBindIds;

    function inviterListsForUser(
        address user
    ) external view returns (userInfo[] memory) {
        uint256 length = _userBindIds[user].length();
        userInfo[] memory users = new userInfo[](length);
        for (uint256 i = 0; i < length; i++) {
            users[i] = getUserById(_userBindIds[user].at(i));
        }
        return users;
    }

    function inviterListsForUserTotal(
        address user
    ) external view returns (uint256) {
        return _userBindIds[user].length();
    }

    function inviterListsForUserPage(
        address user,
        uint256 _ind
    ) external view returns (userInfo memory) {
        return getUserById(_userBindIds[user].at(_ind));
    }

    mapping(address => uint256) public _userId;

    function tokenURI(
        uint256 tokenId
    ) public view override returns (string memory) {
        if (!_exists(tokenId)) revert URIQueryForNonexistentToken();

        if (!istheSame) {
            string memory baseURI = _url;
            return
                bytes(baseURI).length != 0
                    ? string(
                        abi.encodePacked(
                            baseURI,
                            "/",
                            _toString(tokenId),
                            ".json"
                        )
                    )
                    : "";
        } else {
            return _url;
        }
    }
}
